import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = { counter: 0 };
  }
  render() {
    return <div>
      <p>Counter:{this.state.counter}</p>
    </div>;
  }
}

export default App;
